import React, { useState } from 'react';
import './prescriptionF.css';
import { ChevronRight } from 'lucide-react';

const SitemarkCheckout = () => {
  const [formData, setFormData] = useState({
    firstName: 'John',
    lastName: 'Snow',
    addressLine1: '',
    addressLine2: '',
    city: 'New York',
    state: 'NY',
    zipCode: '12345',
    country: 'United States'
  });

  const orderItems = [
    { 
      name: 'Professional plan', 
      description: 'Monthly subscription', 
      price: 15.00 
    },
    { 
      name: 'Dedicated support', 
      description: 'Included in the Professional plan', 
      price: 0 
    },
    { 
      name: 'Hardware', 
      description: 'Devices needed for development', 
      price: 69.99 
    },
    { 
      name: 'Landing page template', 
      description: 'License', 
      price: 49.99 
    }
  ];

  const calculateTotal = () => {
    return orderItems.reduce((total, item) => total + item.price, 0).toFixed(2);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  return (
    <div className="checkout-container">
      <div className="order-summary">
        <div className="total-amount">${calculateTotal()}</div>
        <div className="order-items">
          {orderItems.map((item, index) => (
            <div key={index} className="order-item">
              <div className="order-item-details">
                <span className="order-item-name">{item.name}</span>
                <span className="order-item-description">{item.description}</span>
              </div>
              <span>${item.price.toFixed(2)}</span>
            </div>
          ))}
        </div>
      </div>

      <div className="shipping-form">
        <div className="form-steps">
          <span className="form-step active">1. Shipping address</span>
          <span className="form-step">2. Payment details</span>
          <span className="form-step">3. Review your order</span>
        </div>

        <div className="form-header">
          <div className="form-header-dot"></div>
          <h2>Shipping address</h2>
        </div>

        <form>
          <div className="input-row">
            <div className="input-container">
              <input
                type="text"
                name="firstName"
                placeholder="First name"
                value={formData.firstName}
                onChange={handleInputChange}
              />
            </div>
            <div className="input-container">
              <input
                type="text"
                name="lastName"
                placeholder="Last name"
                value={formData.lastName}
                onChange={handleInputChange}
              />
            </div>
          </div>

          <div className="input-container" style={{ marginBottom: '15px' }}>
            <input
              type="text"
              name="addressLine1"
              placeholder="Street name and number"
              value={formData.addressLine1}
              onChange={handleInputChange}
            />
          </div>

          <div className="input-container" style={{ marginBottom: '15px' }}>
            <input
              type="text"
              name="addressLine2"
              placeholder="Apartment, suite, unit, etc. (optional)"
              value={formData.addressLine2}
              onChange={handleInputChange}
            />
          </div>

          <div className="input-row">
            <div className="input-container">
              <input
                type="text"
                name="city"
                placeholder="City"
                value={formData.city}
                onChange={handleInputChange}
              />
            </div>
            <div className="input-container">
              <input
                type="text"
                name="state"
                placeholder="State"
                value={formData.state}
                onChange={handleInputChange}
              />
            </div>
          </div>

          <div className="input-row">
            <div className="input-container">
              <input
                type="text"
                name="zipCode"
                placeholder="Zip / Postal code"
                value={formData.zipCode}
                onChange={handleInputChange}
              />
            </div>
            <div className="input-container">
              <input
                type="text"
                name="country"
                placeholder="Country"
                value={formData.country}
                onChange={handleInputChange}
              />
            </div>
          </div>

          <div className="checkbox-container">
            <input type="checkbox" id="use-for-payment" />
            <label htmlFor="use-for-payment">
              Use this address for payment details
            </label>
          </div>

          <button type="button" className="next-button">
            Next
            <ChevronRight className="next-button-icon" size={20} />
          </button>
        </form>
      </div>
    </div>
  );
};

export default SitemarkCheckout;
